import axios from "axios";
import { useEffect, useMemo, useState } from "react";
import Table from "layouts/listallentries/tables/Table";

const [data, setData] = useState([]);
const [entryId, setEntryId] = useState(1);
const [name, setName] = useState(1);
const [createdAt, setCreatedAt] = useState(1);
const [updatedAt, setUpdatedAt] = useState(1);

const columns = useMemo(
  () => [
    {
      // Primeiro grupo - Informações do passageiro
      Header: "Informações do passageiro",
      // Colunas do primeiro grupo
      columns: [
        {
          Header: "Nome",
          accessor: "name",
        },
        {
          Header: "Viagens",
          accessor: "trips",
        },
      ],
    },
    {
      // Segundo grupo - Detalhes do vôo
      Header: "Detalhes do vôo",
      // Colunas do segundo grupo
      columns: [
        {
          Header: "Nome",
          accessor: "airline[0].name",
        },
        {
          Header: "País",
          accessor: "airline[0].country",
        },
        {
          Header: "Slogan",
          accessor: "airline[0].slogan",
        },
      ],
    },
  ],
  []
);

function ListAllEntries() {
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      setData(res.data);
      setEntryId(entryId);
      setName(name);
      setCreatedAt(createdAt);
      setUpdatedAt(updatedAt);
    });
  });

  return (
    <div>
      <Table columns={columns} data={data} />
    </div>
  );
}
export default ListAllEntries;
